import { useState } from 'react'
import './AddNew.css'
function AdminRouter(){
    const [editing,setEditing] = useState(true)
    const [addnew, setNew] = useState(true)
    return(
    <div className='addNew'>
        {editing && addnew==true?(
        <>
        <div className='HeaderPanel'>Здравствуйте, администратор</div>
        <button className='submitadmin' >Удалить или редактировать</button>
        <button className='submitadmin'>Добавить новость</button>
        </>
    ):editing ? (<Spisok/>): addnew ? (<Addnew/>):(<></>)}
    </div>)
}
function Spisok(){
    const [spisok, setSpisok] = useState([])
    return(<div>попа</div>)
}
function Addnew(){
    return(
        <div>Добавить новость
            <input id= 'name' placeholder='Введите название' type='text'></input>
            <textarea id = 'discription' placeholder='Введите описание'></textarea>
            <button className='submit'>Загрузить новость</button>
        </div>
    )
}
export default AdminRouter
